import { Container, Card, CardContent, Typography } from '@mui/material';
import './text.css'

export default function Timeline() {
    const educationArr = [
        {
            date: '2012 - 2016',
            description: 'Chung Cheng High School Yishun'
        }
    ]

    return (
        <Container>
            <div className='v_line'>
                {
                    educationArr && educationArr.map((item, id) => {
                        return (
                            <div>
                                <h3></h3>
                                <p>item.description</p>
                            </div>
                        )
                    })
                }
                <Card variant='outlined'>
                    <h3>2012 - 2016</h3>
                    <p>Chung Cheng High School Yishun</p> 
                </Card>
                <Card variant='outlined'>
                    <h3>2016 - 2018</h3>
                    <p>Innova Junior College</p> 
                </Card>
                <Card variant='outlined'>
                    <h3>2021 - current</h3> 
                    <p> Computing major at National Univeristy of Singapore</p> 
                </Card>
            </div>
        </Container>
    )
}
